import 'package:flutter/material.dart';
import 'package:go_router/go_router.dart';
import 'package:tp_cierre_cuatri/entities/users.dart';
import 'package:tp_cierre_cuatri/screens/description_screen.dart';

// ignore: must_be_immutable
class HomeScreen extends StatelessWidget {
  static const String name = 'home';
  HomeScreen({super.key});

  @override
  Widget build(BuildContext context) {

    List<Paises> pais = [
      Paises('Francia', 'París', 'París es la capital de Francia, un país de Europa que cuenta con 68 millones de habitantes. Su idioma oficial es el francés', 'data:image/png;base64,'),
      Paises('Gran Bretaña', 'Londres' , 'Londres es la capital de Gran Bretaña, un país de Europa que cuenta con 56 millones de habitantes. Su idioma oficial es el inglés', 'data:image/png;base64,'),
      Paises('Estados Unidos', 'Washington', 'Washington es la capital de Estados Unidos, un país de América que cuenta con 333 millones de habitantes. Su idioma oficial es el inglés', 'data:image/png;base64,'),
      Paises('Israel', 'Jerusalem', 'Jerusalém es la capital de Israel, un país de Medio Oriente que cuenta con 9.5 millones de habitantes. Su idioma oficial es el hebreo', 'data:image/png;base64,'),
      Paises('Argentina', 'Buenos Aires', 'Buenos Aires es la capital de Argentina, un país de América que cuenta con 46 millones de habitantes. Su idioma oficial es el español', 'data:image/png;base64,'),
      Paises('Brasil', 'Brasilia', 'Brasilia es la capital de Brasil, un país de América que cuenta con 215 millones de habitantes. Su idioma oficial es el portugués', 'data:image/png;base64,'),
      Paises('México', 'Ciudad de México', 'Ciudad de México es la capital de México, un país de América que cuenta con 127.5 millones de habitantes. Su idioma oficial es el español', 'data:image/png;base64,'),
    ];

   
    return Scaffold(
        appBar: AppBar(
          title: const Text('Pantalla lista'),
        ),
        body: ListView.builder(
            itemCount: pais.length,
            itemBuilder: (context, index) {
              return Card(
                child: ListTile(
              title: Text(pais[index].pais),
              subtitle: Text(pais[index].capital),
              leading: SizedBox(width: 50, height: 50, child: Image.network(pais[index].bandera)),
              onTap: (){
                context.pushNamed(DescriptionScreen.name, extra: pais[index]);
              }
            ),
                );
            }));
  }
}